import React , { useEffect } from 'react';
import { getPokemones } from '../services.js'

export function PokeList (props){

useEffect( async () => {
    var pokemones = await getPokemones;
    pokemones.forEach(pokemon => {
       console.log(pokemones.name); 
    });
}, [])

}
